webpackJsonp([0x7f81a276acad],{3415:function(a,t){a.exports={data:{markdownRemark:{html:'<p>「格ゲ作るからキャラ設定作ってー」と友人に頼まれて描いた一枚。 尤も、自分も当時は格ゲー作るだけの技術力はなかった。でも悔しいのでKFX上でプロトタイプ版作って内輪だけで晒したが、すでにその友人は違うベクトルに興味が向いていたようだった。ちなみにその友人は設定資料集だけで満足してしまって、結局本制作に着手されることはなかった。  しっかし、つくづく周囲の絵師さんに影響されやすいなぁ自分。<a href="/2902">12歳頃からずっとそうだ</a>。ヘタすると今でもこの癖は抜けきっていない。</p>',frontmatter:{cover:null,date:"1998-09-01T00:00:00+09:00",strDate:"1998/8/31",title:"オリジナルキャラ"}}},pathContext:{path:"/ja/blog/1998/09/01-ryo/",langKey:"ja"}}}});
